/** @format */

import React from "react";
import HomeWidget from "../components/HomeWidget";

const Home = () => {
	return (
		<Container>
			<Wrapper>
				<HomeWidgets>
					<HomeWidget
						title={"Revenue"}
						value={"2,415"}
						description="compared to last month"
						change={"-11.4"}
						isPositive={false}
					/>
				</HomeWidgets>
			</Wrapper>
		</Container>
	);
};

export default Home;

const Container = styled.div``;
const Wrapper = styled.div``;
const HomeWidgets = styled.div``;
